import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import AuthProvider from "./Context/AuthProvider";
import Header from "./Pages/Header/Header";
import Home from "./Pages/Home/Home/Home";
import Login from "./Pages/Login/Login";
import Register from "./Pages/Register/Register";
import AdminLogin from "./Pages/Admin/AdminLogin";
import AdminDashboard from "./Pages/Admin/AdminDashboard";
import PrivateRoute from "./PrivateRoute";
import AdminPrivateRoute from "./AdminPrivateRoute";
import Success from "./Pages/Success/Success";
import Empty from "./Pages/Empty/Empty";
import Footer from "./Pages/Footer/Footer";
import AllTours from "./Pages/AllTours/AllTours";
import TourBooking from "./Pages/Home/TourBooking/TourBooking";
import MyBookings from "./Pages/MyBookings/MyBookings";
import ManageBookings from "./Pages/MangeBookings/ManageBookings";
import AddTours from "./Pages/AddTours/AddTours";
import About from "./Pages/About/About";

function App() {
  return (
    <div className="App">
      <AuthProvider>
        <Router>
          <Header />
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/home" component={Home} />
            <Route path="/login" component={Login} />
            <Route path="/register" component={Register} />
            <Route path="/admin/login" component={AdminLogin} />
            <AdminPrivateRoute path="/admin/dashboard" component={AdminDashboard} />
            <PrivateRoute path="/allTours" component={AllTours} />
            <PrivateRoute path="/tour/:tourId" component={TourBooking} />
            <PrivateRoute path="/myBookings" component={MyBookings} />
            <PrivateRoute path="/manageBookings" component={ManageBookings} />
            <PrivateRoute path="/addTours" component={AddTours} />
            <PrivateRoute path="/success" component={Success} />
            <Route component={Empty} />
          </Switch>
          <Footer />
        </Router>
      </AuthProvider>
    </div>
  );
}

export default App;
